    render(){
    return (
        <div id="principal">
            <div className="form-login">                                            
                <img src={logo} className="logo" alt="Eventos Logo" />                   
                <button type="submit">Login</button>                                        
            </div>
        </div>
    );
  }
}

export default Checkin;
